    return (
        <div id="mybody">
            <BannerSlider
                defaultBackground={Theme.colors.platinum}
                images={['/yellow_house.jpg', '/3foyer.jpg', '/4livingroom.jpg', '/9kitchen.jpg', '/kitchen_living.jpg']}
                height={700}
                cover='rgba(25, 34, 20, .6)'
            />
            <div id='mybody'>
                <h1>Home Test</h1>
                <style jsx>{`
                    #mybody {
                        float: left;
                        min-height: 800px;
                    }
                `}</style>
            </div>
        </div>
    )
}

export default Index
